import { theme } from "../../config";
import { ListBanner } from "../Banner/list";

export const MoreProducts = () => {
  return (
    <div
      style={{
        position: "relative",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        marginBottom: theme.spacing(4),
      }}
    >
      <ListBanner style={{ height: "60vh" }} />
      <PlayButton />
    </div>
  );
};
